import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import Card from './Card';
import 'tachyons';
import {cats} from './cats.js'

ReactDOM.render(
            <div>
              <Card id={cats[0].id} name={cats[0].name} loves={cats[0].loves}/>
              <Card id={cats[1].id} name={cats[1].name} loves={cats[1].loves}/>
              <Card id={cats[2].id} name={cats[2].name} loves={cats[2].loves}/>
              <Card id={cats[3].id} name={cats[3].name} loves={cats[3].loves}/>
              <Card id={cats[4].id} name={cats[4].name} loves={cats[4].loves}/>
              <Card id={cats[5].id} name={cats[5].name} loves={cats[5].loves}/>
            </div>
            , document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
